import React, { useEffect, useState } from 'react'
import Navbar from '../components/Navbar/NavBar'
import "./mainpage.css"
import PersonalInfo from '../components/formComponents/PersonalInfo'
import FavouriteBooks from '../components/formComponents/FavouriteBooks'
export default function Mainpage() {
    const [step,setstep]=useState(1)
    const Nextfun=()=>{
        if(step<4){
            setstep(setstep + 1)
        }
    }
    const Prevfun=()=>{
        if(step<4){
            setstep(setstep - 1)
        }
        
    }
    useEffect(()=>{
        console.log(step)
    },[step])
    console.log(step)
  return (<>
  <Navbar/>
    <div className="MainpageWrapper">
    <div className="innerwrapper">
<div className="formwrapper">
    <div className="upperform">
<PersonalInfo/>
{/* <FavouriteBooks/> */}
    </div>
    <div className="bottomform">
    <div className="pagecount">
        <ul className="countlist">
            <li className="listItem" >1</li>
            <li className="listItem">2</li>
            <li className="listItem">3</li>
            <li className="listItem">4</li>
        </ul>
    </div>
    <div className="bottombutton">
        <button className="prev btn" onClick={Prevfun}>Previous</button>
        <button className="next btn" onClick={Nextfun}>Next</button>
    </div>
    </div>
</div>
    </div>
    </div>
  </>

  )
}
